import { Link } from "react-router-dom"
import React from "react"
import "./Nav.css"
const Nav = ()=>{
    return (
        <nav>
            <ul>
                <li><Link path= "/order">Đặt hàng</Link></li>
                <li><Link path >Kiểm hàng</Link></li>
            </ul>
        </nav>
    )
}
export default Nav;
